import React, { Component } from 'react';
import { Select } from 'antd';
//引入css文件
import './style.css';

export default class Sider_fouth extends Component {

    //添加查看方式下拉框的数据
    mapRenderEventOption = () => {
        return this.props.events.map(item => {
            return (
                <Option key={item.id + 'c'}>{item.name}</Option>
            )
        })
    }

    render() {
        return (
            <Select
                className='select_bottom'
                defaultValue='事件名'
            >
            </Select>
        )
    }
}
